So I spent weeks building an AI version of myself using voice cloning, deepfakes and script generation...and the results were honestly terrifying. When I sent the final video to my friends with zero context, most of them couldn't tell it wasn't really me. Are we actually ready for AI to replace content creators or are we all just screwed?

